import React, { Component } from 'react';
import ReactGA from 'react-ga';
import $ from 'jquery';
import './App.css';
import Header from './Components/Header';
import Footer from './Components/Footer';
import About from './Components/About';
import Resume from './Components/Resume';
import Contact from './Components/Contact';
import Testimonials from './Components/Testimonials';
import Portfolio from './Components/Portfolio';
// import mountain2 from './img/mountain2.png'
// import cloud from './img/cloud.png'
import Gallery from 'react-grid-gallery';
import ca2 from './img/ca2.gif';
import reunion from './img/reunion.gif';
import post1 from './img/post1.gif';
import post2 from './img/post2.gif';
import post3 from './img/post3.gif';
import heicoders from './img/heicoders.png';
import scis from './img/scis.gif';
import dm from './img/dm.png';

// const IMAGES =
// [{
//         src: {ca},
//         thumbnailWidth: 320,
//         thumbnailHeight: 174,
//         isSelected: true,
//         caption: "After Rain (Jeshu John - designerspics.com)"
// },
// {
//         src: {heicoders},
//         thumbnailWidth: 320,
//         thumbnailHeight: 212,
//         tags: [{value: "Ocean", title: "Ocean"}, {value: "People", title: "People"}],
//         caption: "Boats (Jeshu John - designerspics.com)"
// }]

class App extends Component {

  constructor(props){
    super(props);
    this.state = {
      foo: 'bar',
      resumeData: {}
    };

    ReactGA.initialize('UA-110570651-1');
    ReactGA.pageview(window.location.pathname);

  }

  getResumeData(){
    $.ajax({
      url:'/resumeData.json',
      dataType:'json',
      cache: false,
      success: function(data){
        this.setState({resumeData: data});
      }.bind(this),
      // error: function(xhr, status, err){
      //   console.log(err);
      //   alert(err);
      // }
    });
  }

  componentDidMount(){
    this.getResumeData();
  }

  render() {
    return (
      <div>
      <meta charSet="utf-8" />
      <title>Felice Png</title>
      <link rel="stylesheet" type="text/css" href="style.css" />
      <link rel="stylesheet" type="text/css" href="https://maxcdn.bootstrapcdn.com/font-awesome/4.7.0/css/font-awesome.min.css" />
      <link href="https://fonts.googleapis.com/css?family=Montserrat|Baloo+Chettan+2|Tangerine&display=swap" rel="stylesheet" />
      <link rel="icon" href="img/logo.png" />
      <header>
        <nav>
          <ul>
            <li><a className="active" href="index.html">Home</a></li>
            <li><a href="portfolio.html">Portfolio</a></li>
            <li><a href="">Resume</a></li>
          </ul>
        </nav>
      </header>
      <div className="top-container">
        <div className="Intro">
          <h1><br></br>Hi, I'm Felice</h1>
          <p id="p1">an aspiring software developer.</p> 
        </div>
        <div className="bubbles">
          <div className="bubble" />
          <div className="bubble" />
          <div className="bubble" />
          <div className="bubble" />
          <div className="bubble" />
          <div className="bubble" />
          <div className="bubble" />
          <div className="bubble" />
          <div className="bubble" />
          <div className="bubble" />
        </div>
      </div>   
      <div className="middle-container">
        <div className="profile">
          <p id="p1"><br></br><br></br>... and I design things.</p> 
          <img className="midlogo" src={ca2} alt="ca2" />
          <img className="midlogo" src={heicoders} alt="heicoders" />
          <img className="midlogo" src={reunion} alt="reunion" />
          <img className="midlogo" src={scis} alt="scis" />
          { /* <img className="midlogo" src={dm} alt="dm" /> */ }
          <img className="boxlogo" src={post2} alt="post2" />

          { /* <img className="midlogo" src={reunion} alt="reunion" />
          <img className="boxlogo" src={post3} alt="post3" /> */}
        </div>
      </div>
    </div>
    );
  }
}

export default App;
